import React from 'react';
import Checkbox from '@material-ui/core/Checkbox';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import RefreshIcon from '@material-ui/icons/Refresh';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import {IconButton}from '@material-ui/core';
import KeyboardArrowLeftIcon from '@material-ui/icons/KeyboardArrowLeft';
import KeyboardArrowRightIcon from '@material-ui/icons/KeyboardArrowRight';
import KeyboardIcon from '@material-ui/icons/Keyboard';

import './MainLayoutHeader.css';
function MainLayoutHeader(props) {
    const [anchorEl, setAnchorEl] = React.useState(null);
    const openSimpleMenu = (event) => {
        setAnchorEl(event.currentTarget);
      };

      const handleClose = () => {
        setAnchorEl(null);
      };
    return (
        <>
        <div className="mainLayoutHeader">
            <div className="mainLayoutHeader-left">
                <Checkbox></Checkbox>
                <IconButton>
                    <ArrowDropDownIcon/>
                </IconButton>
                <IconButton>
                    <RefreshIcon/>
                </IconButton>
                <IconButton>
                     <MoreVertIcon/>
                </IconButton>
                <Menu
                    id="simple-menu"
                    anchorEl={anchorEl}
                    keepMounted
                    open={Boolean(anchorEl)}
                    onClose={handleClose}
                >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
                </Menu>
            </div>
            <div className="mainLayoutHeader-right">
                <span>1-5 of 28,404</span>
                <KeyboardArrowLeftIcon/>
                <KeyboardArrowRightIcon/>
                <KeyboardIcon/>
                <ArrowDropDownIcon/>
            </div>
        </div>
        </>
    );
}

export default MainLayoutHeader;
